export const API_DOG = {
    URL: "https://api-ninjas.com/api/dogs",

    BREEDS: function(){
        return `${this.URL}/breeds`
    },

    BREEDS_BY_ID: function (id){
        return `${this.URL}/breeds/${id}`
    }


}
